import { Button } from "react-bootstrap";

const CustomButton = ({ children }) => {
    return (
        <Button
            variant="success"
            className="mt-4 bg-gray text-success border-0 rounded-0 hover">
            {children}
        </Button>
    );
}

export default CustomButton;
